import React from 'react';
import './Cards.css';
import CardItem from './CardItem';
import port from './images/ChristyPortfolio.jpg';
import dungeon from './images/DungeonDijkstra.jpg';
import cal from './images/Calculator.jpg';
import note from './image/NoteTaking.jpg';
import tic from './images/TicTaoToe.jpg';


function Cards() {
  return (
    <div className='cards'>
      <h1>Come check out my GitHub Projects!</h1>
      <div className='cards__container'>
        <div className='cards__wrapper'>
          <ul className='cards__items'>
            <CardItem
              src={port} 
              text="Explore the code behind this page to see how it's structured and functions"
              label='Portfolio'
              path='https://github.com/ChristyYuen/ChristyCreates'
            />
            <CardItem
              src= {i}
              text='Travel through the Islands of Bali in a Private Cruise'
              label='Luxury'
              path='/services'
            />
          </ul>
          <ul className='cards__items'>
            <CardItem
              src={img3}
              text='Set Sail in the Atlantic Ocean visiting Uncharted Waters'
              label='Mystery'
              path='/services'
            />
            <CardItem
              src={img4}
              text='Experience Football on Top of the Himilayan Mountains'
              label='Adventure'
              path='/products'
            />
            <CardItem
              src={img8}
              text='Ride through the Sahara Desert on a guided camel tour'
              label='Adrenaline'
              path='/sign-up'
            />
          </ul>
        </div>
      </div>
    </div>
  );
}

export default Cards;
